Input: Mr. Patrick is preparing a five-question true-false quiz for his class. He flips a coin before writing the first question. If it is heads, he writes a true statement and if it is tails, he writes a false statement. He continues this until all five statements are written. What is the probability that the correct sequence of answers is TFTFT ? Express your answer as a common fraction. Choices: a) \\frac{1}{6} b) \\frac{1}{64} c) \\frac{1}{32} d) \\frac{1}{2} 
Output:
First, we need to realize that each question has two possible outcomes: true or false. 
Second, since each question is independent of the others, we can multiply the probabilities of each individual question being correct.
Third, the probability of getting a specific sequence like TFTFT is (1/2) * (1/2) * (1/2) * (1/2) * (1/2) = 1/32.

{'sol': 'c'}

Input: A point $(x,y)$ is randomly picked from inside the rectangle with vertices $(0,0)$, $(3,0)$, $(3,2)$, and $(0,2)$. What is the probability that $x < y$? Choices: a) \\frac{1}{12} b) \\frac{1}{6} c) \\frac{2}{3} d) \\frac{1}{3} 
Output:
First, we need to visualize the rectangle and the condition $x<y$.  The line $x=y$ divides the rectangle into two regions.  Points where $x<y$ lie in the upper-left triangle.

Second, we need to find the area of the rectangle and the area of the triangle. The rectangle has area $3\cdot2=6$. The triangle has base and height both equal to 2, so its area is $\frac{1}{2}\cdot2\cdot2=2$.

Third, the probability is the ratio of the favorable area to the total area: $2/6=1/3$.

{'sol': 'd'}

Input: Three points are chosen randomly and independently on a circle. What is the probability that all three pairwise distances between the points are less than the radius of the circle? Choices: a) \\frac{1}{20} b) \\frac{1}{32} c) \\frac{1}{12} d) \\frac{1}{16} 
Output:
First, we can visualize the problem. Imagine a circle and three points randomly placed on it. 
Second, we need to understand the condition for all pairwise distances to be less than the radius. This means the three points must lie within a smaller circle inscribed within the original circle.
Third, we can use geometry to determine the probability. The probability depends on the relative areas of the inscribed circle and the original circle.  The ratio of these areas will give us the probability. 

{'sol': 'c'}

Input: The height (in meters) of a shot cannonball follows a trajectory given by $h(t) = -4.9t^2 + 14t - 0.4$ at time $t$ (in seconds). As an improper fraction, for how long is the cannonball above a height of $6$ meters? Choices: a) \\frac{5}{7} b) \\frac{7}{12} c) \\frac{12}{7} d) \\frac{7}{5} 
Output:
First, we need to find the times when the height of the cannonball is equal to 6 meters. This means we need to solve the equation: $-4.9t^2 + 14t - 0.4 = 6$.
Next, we rearrange the equation to get a quadratic equation: $-4.9t^2 + 14t - 6.4 = 0$.
Finally, we can solve this quadratic equation for *t*. We can use the quadratic formula: $t = \frac{-b \pm \sqrt{b^2 - 4ac}}{2a}$, where $a = -4.9$, $b = 14$, and $c = -6.4$.  Solving this will give us two values for *t*, representing the times when the cannonball is at a height of 6 meters.  The difference between these two times will tell us how long the cannonball is above a height of 6 meters.

{'sol': 'c'}

Input: When three standard dice are tossed, the numbers $a,b,c$ are obtained. Find the probability that $abc = 180$. Choices: a) \\frac{1}{30} b) \\frac{1}{72} c) \\frac{1}{71} d) \\frac{1}{70} 
Output:
First, we need to find the prime factorization of 180: $180 = 2^2 \cdot 3^2 \cdot 5$. 
Second, we need to consider the possible combinations of the dice rolls that could result in 180.  Each die can roll a number from 1 to 6, so we need to find the combinations of three numbers that multiply to give us $2^2 \cdot 3^2 \cdot 5$.
Finally, we need to calculate the total number of possible outcomes when rolling three dice. This is $6 \cdot 6 \cdot 6 = 216$.  Then, we divide the number of successful outcomes (combinations that multiply to 180) by the total number of outcomes to get the probability. 

{'sol': 'b'}

Input: Find $x$, given that\[\dfrac{\sqrt{x}}{x\sqrt{3}+\sqrt{2}} = \dfrac{1}{2x\sqrt{6}+4}.\] Choices: a) \\frac{3}{4} b) \\frac{1}{4} c) \\frac{1}{2} d) \\frac{1}{8} 
Output:
First, I will cross-multiply to get rid of the fractions. This gives us: \[\sqrt{x}(2x\sqrt{6}+4) = (x\sqrt{3}+\sqrt{2}).\] Next, I will distribute on the left side and simplify: \[2x\sqrt{6x}+4\sqrt{x} = x\sqrt{3}+\sqrt{2}.\] Now, I will isolate the $\sqrt{x}$ terms on one side and the other terms on the other side: \[4\sqrt{x} = x\sqrt{3}+\sqrt{2}-2x\sqrt{6x}.\] Finally, I will square both sides to get rid of the square roots: \[16x = (x\sqrt{3}+\sqrt{2}-2x\sqrt{6x})^2.\] Expanding the right side and simplifying will give me a quadratic equation in terms of $x$. Solving this quadratic equation will give me the possible values for $x$. I can then check which of these values satisfy the original equation.

{'sol': 'b'}

Input: Four packages are delivered to four houses, one to each house. If these packages are randomly delivered, what is the probability that exactly two of them are delivered to the correct houses? Express your answer as a common fraction. Choices: a) \\frac{1}{4} b) \\frac{27}{128} c) \\frac{1}{2} d) \\frac{1}{9} 
Output:
First, we need to find the total number of ways to deliver the packages. There are 4! = 24 ways to arrange the packages.
Next, we need to find the number of ways to deliver exactly two packages to the correct houses. We can choose 2 houses out of 4 in  \(\binom{4}{2}\) = 6 ways. The remaining two packages must be delivered to the wrong houses, and there are 2! = 2 ways to arrange them.
Therefore, the probability of delivering exactly two packages to the correct houses is (6 * 2) / 24 = 12 / 24 = 1/2.
{'sol': 'c'}
